import React from 'react';

import { Navbar, Header, CardCollection, TradeGraph, SalesGraph, Intro } from './container';
import './App.css';


const App = () => { 

  return (
  <div>
    <Navbar />
    <Header />
    <CardCollection />
    <TradeGraph />
    <SalesGraph />
    <Intro />
  </div>
)};

export default App;
